"411 :     private void inlineVariable() {
412 :       Node defParent = def.getParent();
413 :       Node useParent = use.getParent();
414 :       if (def.isAssign()) {
415 :         Node rhs = def.getLastChild();
416 :         rhs.detachFromParent();
417 :         // Oh yes! I have grandparent to remove this.
418 :         Preconditions.checkState(defParent.isExprResult());
419 :         while (defParent.getParent().isLabel()) {
420 :           defParent = defParent.getParent();
421 :         }
422 :         defParent.detachFromParent();
423 :         useParent.replaceChild(use, rhs);
424 :       } else if (defParent.isVar()) {
425 :         Node rhs = def.getLastChild();
426 :         def.removeChild(rhs);
427 :         useParent.replaceChild(use, rhs);
428 :       } else {
429 :         Preconditions.checkState(false, "No other definitions can be inlined.");
430 :       }
431 :       compiler.reportCodeChange();
432 :     }"

